import React from "react";
import moment from "moment";

class Counter extends React.Component {
  render() {
    const dateToFormat = "1976-04-19T12:59-0500";
    var a = moment([2007, 0, 28]);
    var b = moment([2007, 0, 29]);
    // "in a day"
    console.log(a.to(b));
    return <h1>moment</h1>;
  }
}
export default Counter;
